    <style media="screen">
      body, html, section {
        width: 100%;
        height: 100%;
      }

      section {
        display: flex;
        flex-wrap: wrap;
        justify-content: space-around;
        align-items: center;
      }

      svg {
        /*width: 183px;*/
        /*height: 183px;*/
        width: 100px;
        height: 100px;
        margin: 5px;
      }

      .stage1,
      .stage2,
      .stage3 {
        /*opacity: 0;*/
      }

      .stage1 {
        /*opacity: 0;*/
        animation: stage3 linear 600ms;
        animation-iteration-count: infinite;
        transform-origin: 50% 50%;
      }

      .stage2 {
        /*opacity: 0;*/
        animation: stage2 linear 600ms;
        animation-iteration-count: infinite;
        transform-origin: 50% 50%;
      }

      .stage3 {
        animation: stage1 linear 600ms;
        animation-iteration-count: infinite;
        transform-origin: 50% 50%;
      }

      /*svg g {
        animation: stage4 linear 1000ms;
        animation-iteration-count: infinite;
        transform-origin: 50% 50%;
      }*/

      /*@keyframes stage1 {
        0%   { opacity: 0 }
        50%  { opacity: 0 }
        80%  { opacity: 0 }
        81%  { opacity: 1 }
        100% { opacity: 1 }
      }

      @keyframes stage2 {
        0%   { opacity: 0 }
        40%  { opacity: 0 }
        41%  { opacity: 1 }
        50%  { opacity: 1 }
        60%  { opacity: 0 }
        61%  { opacity: 0 }

      }

      @keyframes stage3 {
        0%   { opacity: 1 }
        19%  { opacity: 1 }

        50%  { opacity: 0 }
        100% { opacity: 0 }
      }*/

      @keyframes stage1 {
        0%   { opacity: 1 }
        25%  { opacity: 1 }
        26%  { opacity: 0 }
        100% { opacity: 0 }
      }

      @keyframes stage2 {
        0%   { opacity: 0 }
        25%  { opacity: 0 }
        26%  { opacity: 1 }
        50%  { opacity: 1 }
        51%  { opacity: 0 }
        100% { opacity: 0 }
      }

      @keyframes stage3 {
        0%   { opacity: 0 }
        50%  { opacity: 0 }
        51%  { opacity: 1 }
        75%  { opacity: 1 }
        76%  { opacity: 0 }
        100% { opacity: 0 }
      }
